class Solution {
public:
    int countOperations(int num1, int num2) {
        int count=0;
        while(num1&&num2){
            int temp=min(num1,num2);
            num2=max(num1,num2);
            num1=temp;
            num2-=num1;
            count++;
        }
        return count;
    }
};
